import React from "react";

function SignUpDetails() {
  return (
    <div style={{ height: "100%", width: "100%", backgroundColor: "skyblue" }}>
      <div style={{height:"100%", width: "50%", backgroundColor: "pink" }}>
        <p>Name</p>
        <p>Email</p>
        <p>Password</p>
        <p>Confirm Password</p>
      </div>
    </div>
  );
}

export default SignUpDetails;
